            Amount: 1000,
            Status: 'Pending'

        }, {
            id: 3,
            User_name: 'Harsh kumar',
            Transction_Id: 'dfg5423',
            Date: '02/01/2003',
            Product_name: 'jeans',
            Amount: 500,
            Status: 'Cancle'

        }, {
            id: 4,
            User_name: 'Amit kumar yadav',
            Transction_Id: 'dfg542314tfd',
            Date: '02/01/2002',
            Product_name: 'shirt',
            Amount: 200,
            Status: 'Success'

        }, {
            id: 5,
            User_name: 'Nafisul Hasan',
            Transction_Id: 'dfg5423145tfd',
            Date: '02/01/2004',
            Product_name: 'shirt',
            Amount: 500,
            Status: 'Success'

        }])
    }, [])
    return (
        <>
            <Box sx={{ display: 'flex', flexDirection: 'column' }}>
